INSERT INTO `v1_47ef9d0b364574b0834f9efaca1f9b7252cdb199725f848f794786ec3c7ea026` VALUES (602000406, "バトル開始時、すべてのモンスターがＴＰダウン\n50％カット状態になる。", "boss_tp_down_cut", "ＴＰダウンカット", 76020004);
INSERT INTO `v1_47ef9d0b364574b0834f9efaca1f9b7252cdb199725f848f794786ec3c7ea026` VALUES (602000501, "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", 18, "ダメージ減衰", 76020005);
INSERT INTO `v1_47ef9d0b364574b0834f9efaca1f9b7252cdb199725f848f794786ec3c7ea026` VALUES (602000502, "バトル開始時、すべてのキャラのＴＰ上昇の上限値を150にする。", 17, "ＴＰ上昇上限付与", 76020005);
